import React from 'react'

const Home = () => {
    const posts = [
        {
            id: 1,
            title: "Armbars and Headlocks",
            desc: "lorem",
            img: "https://www.pexels.com/photo/two-martial-artists-fighting-each-other-8612476/"
        },
        {
            id: 1,
            title: "Fun Takedowns",
            desc: "lorem",
            img: "https://www.pexels.com/photo/man-and-girl-in-martial-arts-bowing-down-7045593/"
        }

    ]
    return (
        <div className="home">
            <div className="posts">
                {posts.map(post => (
                    <div className="post" key={post.id}>
                        <div className='img'>
                            <img src={post.img} alt=""  />
                        </div>
                        <div className="content">
                            <Link to={'/post'}></Link>
                        </div>
                    </div>
                ))}

            </div>

        </div>
    )
}

export default Home
